import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = ({ onLogout, doctorName }) => {
    return (
        <nav className='w-1/5 px-10 py-10 bg-orange-200 h-screen fixed flex flex-col justify-between'>
            <ul className='flex flex-col gap-10'>
                <li><Link className='border-2 border-black rounded-md px-3 py-2 w-full' to="/doctor">Doctor</Link></li>
                <li className='border-2 border-black rounded-md px-3 py-2'><Link to="/newPatient">New Patient</Link></li>
                <li className='border-2 border-black rounded-md px-3 py-2'><button onClick={onLogout}>Log Out</button></li>
            </ul>

            <div className='border-2 border-black rounded-md'>
                <h1 className='capitalize'>
                    {doctorName}
                </h1>
            </div>
        </nav>
    );
};

export default NavBar;
